import React, { Component } from "react";
import { makeStyles } from "@material-ui/core/styles";
import FacebookIcon from "@material-ui/icons/Facebook";
import LinkedInIcon from "@material-ui/icons/LinkedIn";
import GitHubIcon from "@material-ui/icons/GitHub";
import InstagramIcon from "@material-ui/icons/Instagram";
import IconButton from "@material-ui/core/IconButton";
import Tooltip from "@material-ui/core/Tooltip";
import Link from "@material-ui/core/Link";

const useStyles = makeStyles((theme) => ({
  root: {
    marginTop: theme.spacing(3),
  },

  icon: {
    marginLeft: theme.spacing(5),
    float: "left",
  },

  toolTip: {
    margin: "4px 0",
  },
}));

const SocialMedia = () => {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <div className={classes.icon}>
        <Tooltip title="Facebook" className={classes.toollTip} arrow>
          <Link href="https://www.facebook.com/lim.ziyang.12/">
            <FacebookIcon size="small" />
          </Link>
        </Tooltip>
      </div>
      <div className={classes.icon}>
        <Tooltip title="LinkedIn" arrow>
          <Link href="https://www.linkedin.com/in/zi-yang-lim-a2b651188/">
            <LinkedInIcon size="small" />
          </Link>
        </Tooltip>
      </div>
      <div className={classes.icon}>
        <Tooltip title="GitHub" arrow>
          <Link href="https://github.com/Ziyang-98">
            <GitHubIcon size="small" />
          </Link>
        </Tooltip>
      </div>
      <div className={classes.icon}>
        <Tooltip title="Instagram" arrow>
          <Link href="https://www.instagram.com/_papergoat_/?hl=en">
            <InstagramIcon size="small" />
          </Link>
        </Tooltip>
      </div>
    </div>
  );
};

export default SocialMedia;
